static boolean isObjectLitKey(Node node, Node parent) {
    if (node.getType() == Token.STRING && parent.getType() == Token.OBJECTLIT) {
      int index = 0;
      for (Node current = parent.getFirstChild();
           current != null;
           current = current.getNext()) {
        if (current == node) {
          return index % 2 == 0;
        }
        index++;
      }
    }
    return false;
